import React, { Component } from 'react';
import '../component-styles/project.css'
import Slider from "react-slick";
import ProjectCardDesign from './ProjectCardDesign';
class ProjectsCard extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      slidesToShow: 3,
      slidesToScroll:3,
      autoplay: true,
      speed:500,
    };
    return (
      <div id='project-main-card-container'> 
      <Slider id="react-slick-slider" {...settings}>
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      <div className='project-card-container'><div className="inner-card-container"><ProjectCardDesign/></div></div> 
      </Slider>
    </div>
    );
  }
}

export default  ProjectsCard ;
